import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ScrollView,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';

const AlphabetScreen = ({ navigation }) => {
  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>મૂળાક્ષરો</Text>
        <Text style={styles.englishTitle}>Alphabets</Text>
        <Text style={styles.subtitle}>ગુજરાતી મૂળાક્ષરો શીખો</Text>
        <Text style={styles.englishSubtitle}>Learn Gujarati Alphabets</Text>
      </View>

      <View style={styles.content}>
        <TouchableOpacity
          style={styles.card}
          onPress={() => navigation.navigate('Vowels')}
          activeOpacity={0.8}
        >
          <View style={styles.cardHeader}>
            <Ionicons name="heart" size={40} color="#FF6B6B" />
            <View style={styles.cardTitleContainer}>
              <Text style={styles.cardTitle}>સ્વર</Text>
              <Text style={styles.cardEnglishTitle}>Vowels</Text>
            </View>
          </View>
          <Text style={styles.cardDescription}>
            Learn Gujarati vowels (સ્વર) - the basic sounds that form the foundation of the language.
          </Text>
          <View style={styles.cardFooter}>
            <Text style={styles.cardCount}>13 Vowels</Text>
            <Ionicons name="arrow-forward" size={20} color="#FF6B6B" />
          </View>
        </TouchableOpacity>

        <TouchableOpacity
          style={styles.card}
          onPress={() => navigation.navigate('Consonants')}
          activeOpacity={0.8}
        >
          <View style={styles.cardHeader}>
            <Ionicons name="grid" size={40} color="#4ECDC4" />
            <View style={styles.cardTitleContainer}>
              <Text style={styles.cardTitle}>વ્યંજન</Text>
              <Text style={styles.cardEnglishTitle}>Consonants</Text>
            </View>
          </View>
          <Text style={styles.cardDescription}>
            Learn Gujarati consonants (વ્યંજન) - the building blocks for forming words.
          </Text>
          <View style={styles.cardFooter}>
            <Text style={styles.cardCount}>34 Consonants</Text>
            <Ionicons name="arrow-forward" size={20} color="#4ECDC4" />
          </View>
        </TouchableOpacity>

        <View style={styles.infoCard}>
          <Ionicons name="information-circle" size={30} color="#45B7D1" />
          <View style={styles.infoContent}>
            <Text style={styles.infoTitle}>ગુજરાતી મૂળાક્ષરો</Text>
            <Text style={styles.infoText}>
              Gujarati alphabet consists of 47 letters: 13 vowels and 34 consonants. 
              Each letter has a unique sound and pronunciation.
            </Text>
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    backgroundColor: '#FF6B6B',
    padding: 30,
    alignItems: 'center',
    borderBottomLeftRadius: 30,
    borderBottomRightRadius: 30,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 5,
  },
  englishTitle: {
    fontSize: 16,
    color: 'white',
    marginBottom: 15,
  },
  subtitle: {
    fontSize: 14,
    color: 'white',
    textAlign: 'center',
    marginBottom: 5,
  },
  englishSubtitle: {
    fontSize: 12,
    color: 'white',
    textAlign: 'center',
    opacity: 0.9,
  },
  content: {
    padding: 20,
  },
  card: {
    backgroundColor: 'white',
    borderRadius: 15,
    padding: 20,
    marginBottom: 20,
    elevation: 3,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
  },
  cardHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 15,
  },
  cardTitleContainer: {
    marginLeft: 15,
    flex: 1,
  },
  cardTitle: {
    fontSize: 22,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 2,
  },
  cardEnglishTitle: {
    fontSize: 14,
    color: '#666',
  },
  cardDescription: {
    fontSize: 14,
    color: '#666',
    lineHeight: 20,
    marginBottom: 15,
  },
  cardFooter: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  cardCount: {
    fontSize: 12,
    color: '#999',
    fontWeight: '500',
  },
  infoCard: {
    backgroundColor: '#E3F2FD',
    borderRadius: 15,
    padding: 20,
    flexDirection: 'row',
    alignItems: 'flex-start',
  },
  infoContent: {
    marginLeft: 15,
    flex: 1,
  },
  infoTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: '#1976D2',
    marginBottom: 8,
  },
  infoText: {
    fontSize: 14,
    color: '#424242',
    lineHeight: 20,
  },
});

export default AlphabetScreen;
